package com.jacquis.jacquis_system;

import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;

import com.jacquis.jacquis_system.services.EmpleadoService;

@SpringBootApplication
public class JacquisSystemApplication implements CommandLineRunner{

	public static void main(String[] args) {
		SpringApplication.run(JacquisSystemApplication.class, args);
	}

	EmpleadoService empleadoService;

	@Override
	public void run(String... args) throws Exception {
		System.out.println(empleadoService.getEmpleados());
	}

}
